        public static int LengthOfLongestSubstring(string s) {
            int length = 0;
            string current = "";
            string pot = "";
            int backwards = 0;
            while (length < s.Length) {
                bool exit = false;
                bool goBack = false;
                for (int i = length; i < s.Length; i++) {
                    for (int j = 0; j < pot.Length; j++) {
                        if (s[i].ToString() == pot[j].ToString()) {
                            for (int k = 0; k < pot.Length + 1; k++) {
                                if (s[i - k].ToString() == pot[j].ToString()) {
                                    backwards = k;
                                    goBack = true;
                                }
                            }
                            exit = true;
                        }
                        if (exit) {
                            break;
                        }
                    }
                    if (exit) {
                        if (pot.Length > current.Length) {
                            current = pot;
                            pot = "";
                            if (length != 0 && goBack) {
                                length -= (backwards - 1);
                            }
                        } else {
                            pot = "";
                            if (length != 0 && goBack) {
                                length -= (backwards - 1);
                            }
                        }
                        break;
                    }
                    pot += s[i].ToString();
                    length += 1;
                }
            }
            if (pot.Length > current.Length) {
                return pot.Length;
            }
            return current.Length;
        }
    }

